import React from 'react';

// Приклад списку спонсорів
const sponsors = [
    { name: 'Sponsor 1', website: 'https://www.sponsor1.com', image: 'sponsor1.jpg' },
    { name: 'Sponsor 2', website: 'https://www.sponsor2.com', image: 'sponsor2.jpg' },
    { name: 'Sponsor 3', website: 'https://www.sponsor3.com', image: 'sponsor3.jpg' },
    // Додайте решту спонсорів за аналогією
];

export default function Footer() {
    return (
        <footer>
            <div className="sponsor-pyramid">
                {sponsors.map((sponsor, index) => (
                    <div className="sponsor-card" key={index}>
                        <a href={sponsor.website} target="_blank" rel="noopener noreferrer">
                            <img src={`./img/${sponsor.image}`} alt={sponsor.name} />
                        </a>
                    </div>
                ))}
            </div>
            <p className="footer-text">Всі права захищені &copy;</p>
        </footer>
    );
}
